            content: "Mientras espera la llegada de la reina Dido, Eneas explora el interior del gran templo dedicado a Juno. Para su asombro, descubre que las paredes están decoradas con una serie de frescos que narran vívidamente las batallas de la Guerra de Troya. Ve representadas las luchas de los griegos y los troyanos, la tienda de Reso, la muerte de Troilo, las suplicantes troyanas, el arrastre del cuerpo de Héctor y a él mismo combatiendo entre los príncipes aqueos. Al ver su propia historia y el sufrimiento de su pueblo inmortalizado en arte, Eneas se detiene, llora y encuentra un amargo consuelo, diciendo: 'Aquí también hay lágrimas por las cosas, y los asuntos mortales tocan el corazón'."
